#include <limits.h>
#include <stdbool.h>
#include <stdio.h>



#define V 100


int minDistance(int dist[], bool sptSet[]) //HOT
{

	int min = INT_MAX, min_index;
	

	for (int v = 0; v < V; v++) //LP HOT 
	{
		if (sptSet[v] == false && dist[v] <= min)
			min = dist[v], min_index = v;
	      		
        }

	return min_index;
}


void printSolution(int dist[])
{
        int count=0;
        int vector_result[V] = {0,7,9,12,6,10,8,7,6,7, 10,3,9,7,4,8,1,5,7,4, 11,10,11,7,6,15,6,6,11, 9,9,8,8,7,5,12,11,5,7,15,11,6,8,8,5,9,9,10,12, 13,6,5,14,7,7,8,10,9,14,8,6,8,5,5,11,5,8,14, 9,5,7,8,7,8,8,7,9,9,7,7,8,12,8,10, 8,5,13,9, 9,8,6,10,5,3,9,6,7,10,7,8};
	printf("Vertex \t\t Distance from Source\n");
	for (int i = 0; i < V; i++)
	{
          printf("%d \t\t\t\t %d\n", i, dist[i]);
          if (dist[i] == vector_result[i])
          {
             count = count + 1;
          }
        }
        printf("\nResult = %d \n",count);
}


void dijkstra(int graph[V][V], int src)
{
	int dist[V]; 
	bool sptSet[V]; 
	for (int i = 0; i < V; i++)
		dist[i] = INT_MAX, sptSet[i] = false;

	
	dist[src] = 0;

	//LOOP PERFORATION
	for (int count = 0; count < V - 1; count++) {

		int u = minDistance(dist, sptSet);

		sptSet[u] = true;

		for (int v = 0; v < V; v++)

			if (!sptSet[v] && graph[u][v]
				&& dist[u] != INT_MAX
				&& dist[u] + graph[u][v] < dist[v])
				dist[v] = dist[u] + graph[u][v];
	}

	
	printSolution(dist);
}


